import unittest
from typing import List


class Solution:
    def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:
        m, n = len(mat), len(mat[0])

        q = []
        seen = set()
        for i in range(m):
            for j in range(n):
                if mat[i][j] == 0:
                    for dX, dY in [(1, 0), (0, 1), (-1, 0), (0, -1)]:
                        if 0 <= i + dX < m and 0 <= j + dY < n and mat[i + dX][j + dY]:
                            q.append((i, j))
                            seen.add((i, j))
                            break

        ans = [[0] * n for _ in range(m)]

        nQ = []
        level = 1
        while q:
            x, y = q.pop()
            for dX, dY in [(1, 0), (0, 1), (-1, 0), (0, -1)]:
                if 0 <= x + dX < m and 0 <= y + dY < n and mat[x + dX][y + dY] and (x + dX, y + dY) not in seen:
                    ans[x + dX][y + dY] = level
                    nQ.append((x + dX, y + dY))
                    seen.add((x + dX, y + dY))
            if not q:
                q, nQ = nQ, q
                level += 1

        return ans


